import React from "react";
import Navbar from "../Navbar";
import Footer from "../Footer";
import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";

function Home() {
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div classNameName="card" style={{ width: "18rem" }}>
        {" "}
        {/* style used in key value pair*/}
        <img src="..." classNameName="card-img-top" alt="..." />
        <div classNameName="card-body">
          <h5 classNameName="card-title">Card title</h5>
          <p classNameName="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>
        </div>
        <select className="form-select bg-warning w-25" aria-label="Default select example">
          <option selected className="bg-white"> select menu</option>
          <option className="bg-white" value="1">One</option>
          <option className="bg-white" value="2">Two</option>
          <option className="bg-white" value="3">Three</option>
        </select>
      </div>
      <div>
        <Footer />
      </div>
    </>
  );
}

export default Home;
